/**
 * The details required to initialise the embedded payment UI.
 */
export interface StartEmbeddedPaymentResponse {
    /**
     * An array of SDK script URLs that need to be loaded.
     */
    sdkScriptUrls: string[];
    /**
     * An array of connector script URLs that need to be loaded.
     */
    connectorScriptUrls: string[];
    /**
     * The name of the connector function that needs to be called.
     */
    connectorFunctionName: string;
    /**
     * A JSON blob of parameters required by the connector.
     */
    connectorParametersJson: string;
    /**
     * Indicates whether or not the payment connector UI includes a payment button.
     */
    isPaymentButtonIncluded: boolean;
    /**
     * The URL that needs to be called after a payment has been accepted.
     */
    completePaymentUrl?: string;
}
